import React from "react";

export default function Swap() {
  return (
    // center div with glassmorphism
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "40vh",
        width: "30vw",
        //glassmorphism with black background

        //add black glass effect

        //add border
        border: "1px solid rgba(255, 255, 255, 0.2)",
        //add blur
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "10px",
      }}>
      <div className="row">
        <div className="col-6">
          <h8>Music-Exchanger</h8>
        </div>
        <div className="col-6">
          <h8>Music-Exchanger</h8>
        </div>
      </div>
    </div>
  );
}
